--
-- Table structure for table `events`
--

DROP TABLE IF EXISTS `events`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `events` (
  `event_id` int NOT NULL AUTO_INCREMENT,
  `event_description` varchar(150) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `event_novel_id_fk` int NOT NULL,
  `event_storytime_not_before` date NOT NULL,
  `event_storytime_not_after` date NOT NULL,
  `event_duration` int NOT NULL,
  `event_preceding_event_id` int DEFAULT NULL,
  `event_explanation` varchar(500) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`event_id`),
  KEY `event_novel_id_fk` (`event_novel_id_fk`),
  CONSTRAINT `events_ibfk_2` FOREIGN KEY (`event_novel_id_fk`) REFERENCES `novels` (`novel_id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=265 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

