INSERT INTO `events` VALUES (0,'_CHOOSE AN EVENT',0,'0000-00-00','0000-00-00',0,NULL,NULL),(1,'_NO PRECEDING EVENT',0,'0000-00-00','0000-00-00',0,1,NULL),(70,'R Alma Mereminski is born',7,'1920-02-21','0000-00-00',1,1,'\"[Alma\'s] birthday was the twenty-first of February (making her older than me by five months and twenty-eight days)\" (128)'),(71,'R Leo is born',7,'1920-08-18','0000-00-00',1,70,'\"Leopold Gursky started dying on August 18, 1920\"'),(72,'R Leo and Alma fall in love',7,'1930-00-00','1940-00-00',0,71,'Leo meets Alma \"a year\" (125) after he \"was nine\" (124); Alma leaves for America in 1940.'),(73,'R Zvi sees Leo and Alma kiss',7,'1936-05-01','1936-07-31',1,72,'\"Litvinoff remembered the day, early in the summer of 1936\" (184)'),(74,'R Alma Mereminski leaves for America',7,'1940-02-01','1940-04-30',0,73,'Isaac was born after Oct 8 1940 and before Nov 1 1940. Alma \"threw up the whole way\" (12) to America. Morning sickness usually occurs within the first trimester. This date range encompasses the first trimester.'),(75,'R Isaac is born',7,'1940-10-08','1940-10-31',1,74,'Isaac was 60 when he died the Tuesday before Saturday, October 7 (77, 80), and was probably conceived when both Alma and Leo \"were seventeen\" (11). This date range accommodates for each of their birthdays.'),(76,'R Zvi steals Leo\'s obituary',7,'1940-01-27','1941-07-31',1,75,'This event happened after Alma leaves for America (and after Isaac Babel dies), and before Zvi leaves for Chile.'),(77,'R Leo completes The History of Love',7,'1940-01-27','1941-07-31',1,76,'This event happened after Alma leaves for America and before Zvi leaves for Chile.'),(78,'R Zvi leaves for Chile with The History of Love',7,'1941-01-01','1941-07-31',0,77,'Zvi \"moved to Chile in 1941\" (74), but he moved before the Nazis invaded Slonim. Zvi received The History of Love \"on his last morning in Poland\" (153)'),(79,'R The Nazis invade Slonim',7,'1941-07-01','1941-07-31',0,78,'Google it.'),(80,'R Leo escapes the Nazis',7,'1941-07-01','1945-02-28',0,79,'Leo \"spent three and a half years hiding\" (12).'),(81,'R Alma refuses Leo\'s proposal',7,'1945-10-01','1946-08-18',1,82,'Leo was 25 and Isaac was 5 (13); this event happened after Isaac\'s 5th birthday and before Leo\'s 26th.'),(82,'R Leo leaves for America',7,'1945-01-01','1945-10-31',0,80,'This event happened after Leo spent \"three and a half years hiding\" (12) but before Isaac\'s 5th birthday.'),(83,'R Zvi learns about his family\'s death',7,'1945-09-02','1951-09-30',1,81,'This event probably happened after \"the War ended\" but before \"he turned thirty-two\" (156).'),(84,'R Zvi and Rosa meet',7,'1951-09-01','1951-11-01',1,83,'\"I met Zvi in Valparaiso, in the fall of 1951\" (65).'),(85,'R Zvi and Rosa finish translating The History of Love',7,'1952-01-01','1952-12-31',1,84,'This event probably occurred \"sixteen years\" after \"1936\" (184).'),(86,'R Zvi adds Leo\'s obituary to The History of Love',7,'1954-01-01','1962-12-31',1,85,'This event occurred years before The History of Love was published; the latest possible date of publication is 1964, and years (plural) indicates a minimum of two. I forget how we decided on 1954.'),(87,'R Zvi publishes The History of Love',7,'1954-09-01','1964-01-01',1,86,'This event happened after he showed his manuscript to editors \"in the fall of 1954\" (68). I forget how we decided on 1964.'),(88,'E Alma Mereminski is born',5,'1920-02-21','1920-02-21',1,1,'\"I knew her birthday was twenty-first of February (making her older than me by five months and twenty-eight days)\"(28)'),(89,'E Leo is born',5,'1920-08-18','1920-08-18',1,88,'\"Leopold Gursky started dying on August 18, 1920\" (255)'),(90,'E Leo and Alma fall in love',5,'1930-00-00','1940-00-00',0,89,'\"When they were ten he asked her to marry him\" (11) Alma and Leo were born in 1920, therefore when they were 10 the year would have been 1930. \"After she left, everything fell apart\" (8) \"In the summer of 1941 the Einsatzgruppen drove deeper east\" (12) Alma leaves before Slonim is invaded, therefore before 1941 and has Isaac in 1940, so she would have have to have left sometime before 1940.'),(91,'R Rosa destroys the manuscript of The History of Love',7,'1954-09-01','1964-01-01',1,87,'This event happened after the publication of The History of Love; re: 1964.'),(92,'R David Singer buys The History of Love',7,'1971-01-01','1971-12-31',1,91,'David was 22 when he bought it (176). He was 10 years older than Charlotte, and Charlotte is 41 when Alma is 15 (38).  Alma is born in 1985.'),(93,'R Charlotte and David meet',7,'1975-01-01','1978-12-31',1,92,'Charlotte met David \"the summer before she started Oxford\' (37-8).'),(94,'R Zvi dies',7,'1978-01-01','1978-12-31',1,93,'\"...until his death in 1978...\" (68).'),(95,'R Leo and Bruno reunite',7,'1945-10-01','1998-01-01',1,81,'This event happened after Alma refuses Leo, but before the events of the book. Note: the date is closer to 1998 than 1945 because Bruno\'s \"hair was white and thin\" (6).'),(96,'R Alma Singer is born',7,'1985-09-14','1985-09-28',1,95,''),(97,'R David Singer dies',7,'1992-09-14','1993-09-28',1,96,'\"MY FATHER DIED WHEN I WAS SEVEN\" (37).'),(98,'R Alma Mereminski dies',7,'1995-01-01','1995-12-31',1,97,'She \"died five years ago\" (85). Leo narrates from the year 2000.'),(99,'R Alma becomes Misha\'s pen pal',7,'1997-09-28','1998-02-28',1,98,'\"He was almost thirteen, five months older than I\" (98).'),(100,'R Leo begins to write again',7,'1998-01-01','1998-12-31',1,99,'\"A couple of months after my heart attack, fifty-seven years after I\'d given it up, I started to write again\" (9).'),(101,'R Charlotte receives Isaac\'s first letter',7,'2000-02-01','2000-02-28',1,100,'\"...in the middle of last February a letter arrived...\" (55).'),(102,'R Alma begins searching for Alma Mereminski',7,'2000-07-14','2000-08-01',1,101,'\"It was already the end of July\" (102).'),(103,'R Alma and Misha kiss (for the second time ??)',7,'2000-08-14','2000-09-01',1,102,'\"TWO WEEKS PASSED, MISHA AND I STILL HADN\'T TALKED\" (143). Note: \"...the summer before, when we were thirteen and stood on the roof of his building, the tar soft under our feet, our tongues in each other\'s mouths...\" (141).'),(104,'R Alma realises Alma Mereminski had married',7,'2000-08-14','2000-09-01',1,103,'This event happened after Alma and Misha kissed, but before September: \"I\'ll be fifteen next month\" (148).'),(105,'R Alma reads Bird\'s journal',7,'2000-08-15','2000-09-28',1,104,'This event happened before Alma\'s fifteenth birthday.'),(106,'R Alma realises Alma Mereminski has died',7,'2000-08-16','2000-09-28',1,105,'This event happened before Alma\'s fifteenth birthday.'),(107,'R Alma realises Jacob Marcus is Isaac Moritz',7,'2000-09-14','2000-09-30',1,106,'This event happened either on or after \"the morning of [Alma\'s] fifteenth birthday\" (194) but before she asked Herman to drive her to Isaac\'s house.'),(108,'R Leo sends WORDS FOR EVERYTHING to Isaac',7,'2000-09-20','0000-00-00',1,107,''),(109,'R Misha calls for Alma (exposing her search for someone to Bird)',7,'2000-10-03','0000-00-00',1,110,'\"October 3\" (206).'),(110,'R Alma and Herman go to Isaac\'s house (Alma leaves her phone number there)',7,'2000-09-25','0000-00-00',1,108,'\"A week and a half later\" is \"October 5th\" (202).'),(111,'R Isaac dies',7,'2000-10-03','0000-00-00',1,109,'He died the \"Tuesday night\" (77) before \"Saturday, October 7\" (80).'),(112,'R Leo learns of Isaac\'s death',7,'2000-10-05','0000-00-00',1,111,'He reads the article the day before Friday, October 6th (80).'),(113,'R Alma learns of Isaac\'s death',7,'2000-10-05','0000-00-00',1,112,'\"...October 5th...\" (202)'),(114,'R Bernard calls for Alma (revealing Leo\'s identity to Bird)',7,'2000-10-06','0000-00-00',1,113,'\"October 6\" (215).'),(115,'R Bird sends the letters and The History of Love',7,'2000-10-07','0000-00-00',1,114,'\"October 7\" (218).'),(116,'R Bird sends Leo and Alma letters [Obsolete]',7,'2000-10-07','2000-10-17',1,115,'This event happened before the day that Leo and Alma meet, which is October 17.'),(117,'R Leo attends Isaac\'s funeral',7,'2000-10-07','0000-00-00',1,115,'\"A memorial service will be held Saturday, October 7, a 10 AM at Central Synagogue\" (80).'),(118,'R Leo receives The History of Love',7,'2000-10-07','0000-00-00',1,117,'Pg. 92.'),(119,'R Leo leaves to retrieve WORDS FOR EVERYTHING',7,'2000-10-09','0000-00-00',1,118,''),(121,'R Alma receives Bird\'s letter',7,'2000-10-10','2000-10-17',1,119,''),(122,'R Leo learns that Isaac had published WORDS FOR EVERYTHING',7,'2000-10-17','0000-00-00',1,121,'Pg. 211.'),(123,'R Leo finds Bird\'s letter',7,'2000-10-17','0000-00-00',1,122,'Pg. 212.'),(124,'R Alma and Leo meet',7,'2000-10-21','0000-00-00',1,123,'After 4:00PM (212).'),(125,'R Alma realises Leo wrote The History of Love',7,'2000-10-21','0000-00-00',1,124,''),(126,'E Zvi sees Leo and Alma kiss',5,'1936-00-00','1936-00-00',1,90,'\"early in the summer of 1936\" (184)'),(127,'E Alma leaves for America',5,'1940-01-00','1940-05-00',0,126,'\"the woman who had been a girl got on a boat to America and threw up the whole way, not because she was seasick but because she was pregnant\"(12) Isaac was born after October 8 1940 and before November 1 1940, and as morning sickness occurs in the first trimester, Alma would have been getting sick between January and May of 1940'),(128,'E Isaac is born',5,'1940-10-08','1940-11-01',1,127,'Isaac \"was 60\" when he died (77) which was October 7th 2000, and accounting for Leo and Alma\'s birthdays, he would have been born between October 8th and November'),(129,'E Zvi steals Leo\'s obituary',5,'1940-00-00','1941-07-00',1,128,'\" they discussed the movements of Hitler\'s armies\" (113) \"Because Litvinoff didn\'t know many people there\" (112) indicates they are not in Slonim, therefore before Leo is laid off and returns home, and it is before Slonim\'s invasion.'),(130,'E Leo completes \'The History of Love\'',5,'1940-00-00','1941-07-00',1,129,'\"I read the pages of the book that I had written as a young man.... A twenty-year-old in love\" (121) which would make the year 1940 and Leo stops writing when Slonim is invaded in 1941'),(131,'E Zvi leaves with \'The History of Love\'',5,'1941-01-00','1941-07-00',0,130,'Leo gives Zvi \"The History of Love\" \"the day [Zvi] left Poland\" (111) and \"Zvi...moved to Chile in 1941\" (74) before Slonim was invaded.'),(132,'E Nazis invade Slonim',5,'1941-07-00','1941-07-00',0,131,'\"In the summer of 1941....On a bright hot day in July they entered Slonim\" (12)'),(133,'E Leo escapes the Nazis',5,'1941-07-00','1945-02-00',0,175,'\"having hidden for three and a half years\" (13): July 1941-January 1945 is 3.5 years, and when Leo arrives in America \"He was twenty-five years old\" (13) which would make the year 1945'),(134,'E Leo leaves for America',5,'1945-01-00','1946-10-00',0,133,'Leo hides for 3.5 years and finds Alma in America when Isaac is 5 years old'),(135,'E Alma refuses Leo\'s proposal',5,'1945-10-00','1946-08-18',1,134,'The novel states that  Leo \"was twenty-five years old\" (13) and Isaac was \"now five\" (13) therefore it is after Isaac turns 5 in October and before Leo\'s 26th birthday'),(136,'E Zvi learns about his family\'s death',5,'1945-09-02','1951-00-00',1,135,'\"The War ended\" (156) World War II ended on September 1st 1945 before Zvi \"learned what had happened\" (156) to his family and before he met Rosa \"in the fall of 1951\" (65)'),(137,'E Zvi and Rosa meet',5,'1951-08-00','1951-12-00',1,136,'\"I met Zvi in Valparaiso, in the fall of 1951\" (65)'),(138,'E Zvi and Rosa finish translating \'The History of Love\'',5,'1952-00-00','1952-00-00',1,137,'\"In the summer of 1936...sixteen years later he watched as another chapter of the book written by Gursky reappeared in his own longhand\" (184-185) 1936 plus 16 years would make it 1952'),(139,'E Zvi adds Leo\'s obituary to \'The Histo